        //             console.log('1');
        //             <p>"dziala"</p>
        //         })}
        //     </>
        // )
        return(

            <div>  
                {window.response===undefined?<Redirect to='/'/>:null}

                {
                this.state.myAppointments.map(
                appointment=>{

                    return (
                    <>
                        <p className = "appointment" key={appointment.id}> Doktor:</p>
                        <p className = "appointment" key={appointment.id}> {appointment.date}:</p>

                    </>)
                }
                )
            }

            </div>

        )
    }
}


export default MyAppointments;
